export class UserGreeting extends Component {

    constructor(props) {
        super(props)
    
        this.state = {
             isLoggedIn: false
        }
    }  

    render() {

        let message
        if (this.state.isLoggedIn) {
            message = <div>Welcome Okky</div>;
        } else {
            message = <div>Welcome Guest</div>; 
        }

    return <div>{message}</div>

